/* npm uninstall パッケージしてから再度インストールする */

class Meuron {

    component;

    constructor(component) {
        this.component = component;
    }

    /* ブラウザ上でしか実行できないメソッド */
    touchDOM() {
        var p = document.createElement("p");
        p.innerText = "まんち！";
        document.body.appendChild(p);
    }

}


module.exports = Meuron;